import React from 'react';
import '../css/RoundProfileImage.css';

function RoundProfileImage(props){
  return(
    <div>
    <img className="roundProfileImage" src={props.imageURL} alt="user"/>
    <h3>{props.username}</h3>
    </div>
  );
}

export default RoundProfileImage
